import React, { useState, useEffect } from "react";
import axios from "axios";
import Swal from 'sweetalert2';
import config from "../../config";
import "./restaurant.css"


export default function RestaurantList() {


  const [data, setData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const token = localStorage.getItem("token");
      if (!token) {
        console.log("User not authenticated.");
        return;
      }

      try {
        const tempData = await getData(token);
        setData(tempData);
        console.log(JSON.stringify(tempData));
      } catch (error) {
        console.log("Error fetching restaurant data:", error);
      }
    };
    fetchData();
  }, []);


  const getData = async (token) => {
    try {
      const finalURL = `${config.apiUrl}/api/restaurant/`;
      const res = await axios.get(finalURL, {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      });
      const  restaurant = res.data?.restaurant || [];

      return  restaurant;
    } catch (error) {
      console.log("Error fetching  Restaurant data:", error);
      throw error;
    }
  };

  const removeRestaurant = async (examId) => {
    try {
        const token = localStorage.getItem("token");
        if (!token) {
            console.log("User not authenticated. Redirecting to login page.");
            return;
        }

        const isConfirmed = await Swal.fire({
            title: 'Are you sure?',
            text: 'You want to delete this Restaurant?',
            icon: 'warning',
            showCancelButton: true,
            confirmButtonColor: '#3085d6',
            cancelButtonColor: '#d33',
            confirmButtonText: 'Yes, delete it!'
        });

        if (isConfirmed.isConfirmed) {
            const finalURL = `${config.apiUrl}/api/restaurant/${examId}`;
            await axios.delete(finalURL, {
                headers: {
                    Authorization: `Bearer ${token}`,
                },
            });

            Swal.fire(
                'Deleted!',
                'The Restaurant has been deleted.',
                'success'
            ).then(() => {
              window.location.reload("false")
            });
        }
    } catch (error) {
        console.log("Error deleting Restaurant:", error);
        Swal.fire(
            'Error!',
            'Failed to delete the Restaurant.',
            'error'
        );
    }
};

const [data1, setData1] = useState({
  Name: "",
  Address: "",
  Telephone: ""
});

function handleChange(evt) {
  const name = evt.target.name;
  const value = evt.target.value;
  setData1({
    ...data1,
    [name]: value,
  });
}

const onSubmitForm = async (e) => {
  try {
      e.preventDefault();

      const token = localStorage.getItem("token");

      const res = await axios({
          method: "post",
          baseURL: config.apiUrl,
          url: "/api/restaurant/create",
          data: data1,
          headers: {
            "Content-Type": "application/json",
            Authorization: `Bearer ${token}`,
          },
      });

      console.log(res.data);
      
      
      Swal.fire({
          icon: 'success',
          title: 'Success!',
          text: 'Data Saved Successfully!',
      }).then(() => {
          window.location.assign("/");
      });
  } catch (error) {
      console.log(error);

      
      Swal.fire({
          icon: 'error',
          title: 'Error',
          text: 'An error occurred while saving the data. Please try again.',
      });
  }
};



  return (
    <div>
       
{/* <!-- Modal --> */}
<div class="modal fade" id="exampleModal" tabindex="-1" aria-labelledby="exampleModalLabel" aria-hidden="true">
  <div class="modal-dialog">
    <div class="modal-content">
      <div class="modal-header">
        <h5 class="modal-title" id="exampleModalLabel">Modal title</h5>
        <button type="button" class="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
      </div>
      <div class="modal-body">
        <div>
        <form class="row g-3" oValidate onSubmit={(e) => onSubmitForm(e)} id="formSubject">
  
  <div class="col-auto">
    <label for="inputText2" class="visually-hidden">Restaurant Name</label>
    <input type="text" class="form-control" id="inputText2" placeholder="Enter Restaurant Name"
    name="Name"
    value={data1.Name}
    onChange={handleChange}/>
  </div>

  <div class="col-auto">
    <label for="inputText2" class="visually-hidden">Address</label>
    <input type="text" class="form-control" id="inputText2" placeholder="Enter Address"
    name="Address"
    value={data1.Address}
    onChange={handleChange}/>
  </div>

  <div class="col-auto">
    <label for="inputText2" class="visually-hidden">Telephone</label>
    <input type="text" class="form-control" id="inputText2" placeholder="Enter Telephone "
    name="Telephone"
    value={data1.Telephone}
    onChange={handleChange}/>
  </div>

  <div class="col-auto">
    <button type="submit" value="Submit" class="btn btn-primary mb-3">Add Restaurant</button>
  </div>
</form>

        </div>
      </div>
      <div class="modal-footer">
        <button type="button" class="btn btn-secondary" data-bs-dismiss="modal">Close</button>
      </div>
    </div>
  </div>
</div>
      <div className='container' id="RestuarantContainer">

         {/* <!-- Button trigger modal --> */}
<button type="button" class="btn btn-primary" data-bs-toggle="modal" data-bs-target="#exampleModal">
  Add Restaurant
</button>

      <table className='table table-hover'>
                    <thead>
                        <tr>
                            <th scope='col'><i className='fas fa-list'></i></th>
                            <th scope='col'>Restaurant Name</th>
                            <th scope='col'>Address</th>
                            <th scope='col'>Telephone</th>
                            <th scope='col'>Action</th>
                        </tr>
                    </thead>

                    <tbody>
                        {data.map((restaurant, index) => (
                            <tr key={index}>
                                <th scope='row'>{index + 1}</th>
                                <td>{restaurant.Name}</td>
                                <td>{restaurant.Address}</td>
                                <td>{restaurant.Telephone}</td>
                                <td>
                                    <a className='btn' id="editBtn" href={`/edit/question/${restaurant._id}`}>
                                        <i className='fas fa-edit' id="editIcon"></i>
                                    </a>
                                    &nbsp;
                                    <button className='btn' id="editDelete" onClick={() => removeRestaurant(restaurant._id)}>
                                        <i className='fas fa-trash-alt' id="DeleteIcon"></i>&nbsp;
                                    </button>
                                    &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
                                    <a href={`/question/${restaurant._id}`} id="view">VIEW</a>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
        </div>
        </div>
    
  
  );
}
